import React, {Component, useState} from 'react';
import { Text, Alert } from 'react-native';

export default class Moisture extends Component {
    constructor(props: any) {
        super(props)
        this.state = {
            id: -1,
            moisture_content: -1,
            time_posted: ''
        };
    }

    componentDidMount() {
        const response = {  
          body: 
            fetch('http://ec2-52-14-234-1.us-east-2.compute.amazonaws.com/moisture', {
              method: 'GET'
            })
            .then((response) => response.json())
            .then((responseJson) => {
                this.setState({
                    id: responseJson.id,
                    moisture_content: responseJson.moisture_content,
                    time_posted: responseJson.time_posted
                });
                console.log(this.state);
            })
            .catch((error) => {
                console.error(error);
            }),
        };
    };

    static getMoisture(): void {
        //const {id, moisture_content, time_posted} = this.state; 
        Alert.alert(
            "Moisture", 
            JSON.stringify(this),
            [
                { text: 'OK'}
            ]
        )
    }

    render() {
        return (
            <Text></Text>
        )
    }
}
